import React from "react";

export default function Analytics({ topicAccuracy }) {
  return (
    <div className="card p-3 mb-4 shadow-sm">
      <h5>Topic-wise Accuracy</h5>
      {Object.keys(topicAccuracy).length === 0 && <p>No topic data available</p>}
      <ul className="list-group">
        {Object.entries(topicAccuracy).map(([topic, acc]) => (
          <li
            key={topic}
            className="list-group-item d-flex justify-content-between align-items-center"
          >
            {topic.charAt(0).toUpperCase() + topic.slice(1)}
            <span className="badge bg-primary rounded-pill">{acc}%</span>
          </li>
        ))}
      </ul>
    </div>
  );
}
